Surubul Fischer PowerFast FPF II CTF este un surub filetat partial, cu o placare zincata, cu cap ingropat si amprenta Torx (TX20). Capul inecat cu amprenta in forma de stea garanteaza o transmisie optima a fortei cu stabilitate maxima a bitului pentru operatiunile de insurubare pe plan. Filetul integrat, care ruleaza pe intreaga lungime a surubului, asigura o transmisie optima a fortei. 
Caracteristici si avantaje:
diametru -  5 mm;
lungime - 100 mm;
ideal pentru fixarea conexiunilor generale de lemn, placari, frize, precum si a elementelor de usi;
geometria lui permite o instalare usoara, confortabila si flexibila. 
Fiecare cutie include 50 de suruburi.

