Surubul Spax T-Star Plus se utilizeaza in orice constructie interioara sau exterioara din lemn, indiferent de dimensiunea si complexitatea acesteia.
Acest surub pentru lemn cu cap saiba si filet total este realizat din sarma de otel cu acoperire wirox, care asigura protectie anticoroziva de 20 ori mai ridicata comparativ cu zincarea argintie, la aceeasi grosime a stratului de suprafata.
Caracteristici principale:
lungime surub (Ls) - 80 mm;
lungime filet (LgV) - 61 mm;
diametru surub (d1) - 6 mm;
diametru surub (dK) - 13.6 mm;
amprenta surub - Torx;
tip bit - T30.
Spax este o companie germana cu o traditie in fabricarea suruburilor. Inovatoare si calitative, suruburile Spax se remarca prin materiale durabile si tehnologie moderna folosita in realizarea lor.

